import Products from "./components/ProductsRender";
import Cart from "./components/Cart";
import GlobalStyle from "./styles/global";

function App() {
  return (
    <>
      <GlobalStyle/>
      <Header>
        <header>
            <h1>Kenzie Hub</h1>
            <Button onClick={() => returnPage('/')}>Voltar</Button>
        </header>
    </Header>
      <div className="App">
          <div>
            <Products />
            <Cart />
          </div>
      </div>
    </>
  );
}

export default App;
